import React from 'react';

import { makeStyles, useTheme } from '@material-ui/core/styles';
import { Grid, Typography } from '@material-ui/core';

import Nav from '../../components/Navigation/Nav';
import Body from '../../components/Home/Main/Body';
import Footer from '../../components/Home/Footer';

const MountainsImg = require('../../components/Home/imgs/1x/background.png');

const useStyles = makeStyles(theme => ({
    container: {
        background: 'linear-gradient(45deg, rgb(182, 217, 185) 0%, rgb(182, 217, 185) 7%,rgb(148, 203, 178) 7%, rgb(148, 203, 178) 16%,rgb(80, 177, 166) 16%, rgb(80, 177, 166) 18%,rgb(46, 163, 159) 18%, rgb(46, 163, 159) 26%,rgb(114, 190, 172) 26%, rgb(114, 190, 172) 37%,rgb(12, 150, 153) 37%, rgb(12, 150, 153) 100%)',
    },
    img: {
        backgroundImage: `url(${MountainsImg})`,
        backgroundSize: 'cover',
        height: '70vh',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },
    typo: {
        color: 'white',
    },
    body: {
    },
}));

function Home() {

    const classes = useStyles();

    return (
        <Grid className={classes.container} container >

            <Grid item xs={12}>

                <Nav />

            </Grid>
            <Grid className={classes.img} item xs={12}>

                <Typography className={classes.typo} variant="h2" align="center">
                    Welcome to our little piece of paradise in the mountains of Boone NC!
                </Typography>

            </Grid>

            <Body />

            <Footer />

        </Grid>
    );
}

export default Home;
